  render: () => {
    const [open, setOpen] = useState(true);
    return <>\r
        <Button onClick={() => setOpen(true)} type={'button'} variant={'default'}>\r
          Open modal\r
        </Button>\r
        <Modal modalTitle={'This is component'} onClose={() => setOpen(false)} open={open} size={'md'}>\r
          <p>\r
            Do you really want to close the creation of a publication? If you close, everything will\r
            be deleted.\r
          </p>\r
          <Flex direction={'row'} gap={'g-xxxl'}>\r
            <Button type={'button'} variant={'secondary'}>\r
              Save draft\r
            </Button>\r
            <Button onClick={() => setOpen(false)} type={'button'} variant={'default'}>\r
              Discard\r
            </Button>\r
          </Flex>\r
        </Modal>\r
      </>;
  }
